script: |
  super -f tsv -I q4646.sql | sort > q4646.out

vector: true

inputs:
  - name: q4646.sql
    data: |
      SELECT 35 + + ( - 10 ) + - - col0 / ( - + col0 ) / col2 * - col2 FROM tab2 AS cor0 WHERE NOT col2 BETWEEN - 22 + + 10 AND + col0 OR NOT + col1 BETWEEN - col2 AND + + col1 / col1 + + ( - 16 );
  - name: tab2

outputs:
  - name: q4646.out
    data: |
      25
      25
      25
